ema database.\",\"chunks\",[],\"finished\",\"source_analysis_msg_id\",\"2ec534d5-2073-4efa-a613-bcf9ab1ad7e1\",{\"_4060\":4061,\"_4062\":4063,\"_4064\":4065,\"_4066\":4067,\"_4068\":58,\"_4069\":4070,\"_4022\":4038,\"_4002\":4003,\"_4020\":4021,\"_4024\":4023,\"_4025\":4027,\"_4005\":4006,\"_4007\":4008,\"_3966\":3926},\"reasoning_status\",\"is_reasoning\",\"citations\",[],\"content_references\",[],\"gizmo_id\",\"g-p-68ee5d18adf481919c0ff0ad5c21433d\",\"classifier_response\",\"skip_reasoning_title\",\"Lewati\",[4072],\"d5475cb4-1ce6-4747-8e3f-9e21bd39dc19\",{\"_26\":4072,\"_3946\":4074,\"_3968\":4041,\"_3942\":4084},{\"_26\":4072,\"_3948\":4075,\"_3934\":4077,\"_3954\":4078,\"_3960\":3961,\"_3962\":32,\"_3963\":1677,\"_3952\":4081,\"_3967\":3328},{\"_3950\":4031,\"_3952\":4076},{},1760453539.083464,{\"_3956\":4079,\"_3954\":4080},\"reasoning_recap\",\"Selesai berpikir selama 15s\",{\"_4060\":4082,\"_4083\":1833,\"_4022\":4038,\"_4002\":4003,\"_4020\":4021,\"_4024\":4023,\"_4025\":4041,\"_4005\":4006,\"_4007\":4008,\"_3966\":3926},\"reasoning_ended\",\"finished_duration_sec\",[4085],\"18b0d379-b1c1-420e-8600-903d6b9d7de9\",{\"_26\":4085,\"_3946\":4087,\"_3968\":4072,\"_3942\":4100},{\"_26\":4085,\"_3948\":4088,\"_3934\":4090,\"_3936\":4091,\"_3954\":4092,\"_3960\":3961,\"_3962\":47,\"_3963\":1677,\"_3952\":4095,\"_3967\":3328,\"_4098\":4099},{\"_3950\":4031,\"_3952\":4089},{},1760453538.962674,1760453622.209731,{\"_3956\":3957,\"_3958\":4093},[4094],\"Siap, el! Berikut **kerangka sistem** dan **flowchart** awal untuk *Sistem Informasi Manajemen Penerimaan \u0026 Penyaluran Dana Anak Yatim*fokus ke alur donasi, verifikasi, alokasi program, penyaluran, dan pelaporan yang rapi (audit-ready).\\n\\n# Kerangka Sistem (High-Level)\\n\\n## 1) Peran Pengguna (RBAC)\\n- **Super Admin**: manajemen cabang/unit, konfigurasi global, audit.\\n- **Keuangan**: input/rekonsiliasi donasi, penyaluran, kas/bank.\\n- **Program/SDM Sosial**: data penerima, asesmen kebutuhan, pengajuan \u0026 verifikasi penyaluran.\\n- **Fundraising/Marketing**: kampanye, target, laporan performa.\\n- **Auditor/Reviewer**: baca-only + akses log \u0026 bukti.\\n- **Donatur (Portal)**: profil, riwayat donasi, e-receipt, laporan dampak.\\n\\n## 2) Modul Utama\\n1. **Master Data**\\n   - Donatur (perorangan/perusahaan), Penerima Manfaat (anak/keluarga/panti), Relawan, Cabang/Unit.\\n   - Program/Kampanye (Beasiswa, Santunan Rutin, Kesehatan, Paket Sekolah, dll).\\n2. **Penerimaan Dana (Income)**\\n   - Kanal: Transfer, QRIS, VA, Tunai, Payment Gateway.\\n   - Fitur: bukti bayar (upload), auto-match mutasi, nomor kwitansi otomatis, **earmark** (ditujukan untuk program tertentu) vs **general fund**.\\n3. **Manajemen Alokasi**\\n   - Aturan alokasi otomatis (misal: 70% program, 20% operasional, 10% cadangan), override dengan otorisasi.\\n   - *Pooled fund* vs *restricted fund* (kampanye khusus).\\n4. **Penyaluran (Disbursement)**\\n   - Pengajuan bantuan (oleh Petugas Program), asesmen, lampiran dokumen.\\n   - Verifikasi berlapis (Program  Keuangan  Approver).\\n   - Eksekusi penyaluran (tunai, transfer massal, e-wallet), tanda terima digital.\\n5. **Kas \u0026 Bank**\\n   - Buku kas, rekonsiliasi bank (import mutasi), kontrol saldo per akun \u0026 per program.\\n6. **Pelaporan \u0026 Transparansi**\\n   - Laporan: penerimaan per kanal/per program, penyaluran per penerima/per wilayah, arus kas, posisi dana terikat vs umum, realisasi kampanye, rasio operasional.\\n   - Dashboard donatur (riwayat, e-receipt, *impact report*).\\n7. **Audit \u0026 Kepatuhan**\\n   - Audit trail (siapa, kapan, apa yang diubah).\\n   - Bukti digital (kuitansi, foto penyerahan, berita acara).\\n   - Log akses dan persetujuan (multi-step approval).\\n8. **Integrasi \u0026 Notifikasi**\\n   - Payment gateway/QRIS/VA, WhatsApp/Email/SMS pemberitahuan.\\n   - Webhook mutasi bank (jika tersedia), export akuntansi (CSV/Excel).\\n9. **Keamanan \u0026 Tata Kelola**\\n   - 2FA, enkripsi bukti, masking data pribadi, backup \u0026 retensi.\\n   - Multi-cabang (opsional multi-tenant per cabang).\\n\\n## 3) Entitas \u0026 Atribut Kunci (ringkas)\\n- **Donatur**: id, nama, tipe, kontak, preferensi program.\\n- **Penerima**: id, nama, NIK opsional, sekolah/kelas, wali, alamat, status verifikasi.\\n- **Program/Kampanye**: id, nama, jenis (rutin/seasonal), target, periode, akun dana.\\n- **Donasi**: id, tanggal, donatur_id, kanal, jumlah_bruto, biaya, jumlah_netto, earmark_program_id (opsional), bukti, status (Menunggu Verifikasi/Tervalidasi/Match Gagal).\\n- **Alokasi**: id, donasi_id, program_id, persentase/nominal.\\n- **Pengajuan Bantuan**: id, penerima_id, program_id, kebutuhan, nominal_diusulkan, lampiran, status (DraftReviewDisetujuiDitolak).\\n- **Penyaluran**: id, pengajuan_id, tanggal_bayar, metode, nominal, bukti_serah, berita_acara, status.\\n- **Kas/Bank**: akun_id, tipe (Kas/Bank), saldo, transaksi_id (link).\\n- **Approval**: id, objek (Donasi/Pengajuan/Penyaluran), level, approver_id, waktu, catatan.\\n\\n---\\n\\n# Flowchart\\n\\n## A. Alur Penerimaan Donasi  Verifikasi  Alokasi  Rekonsiliasi\\n\\n```mermaid\\nflowchart TD\\nA[Donatur berdonasi\\\\n(QRIS/VA/Transfer/Tunai)] --\u003e B{Otomatis masuk?}\\nB -- Gateway/VA Callback --\u003e C[Catat Donasi Draft\\\\n+ bukti/kode referensi]\\nB -- Transfer manual --\u003e D[Upload bukti oleh Keuangan/Donatur]\\nC --\u003e E[Validasi nominal \u0026 kanal]\\nD --\u003e E\\nE --\u003e|OK| F{Earmark?}\\nE --\u003e|Gagal| E2[Flag Gagal Match\\\\nPerlu verifikasi manual]\\n\\nF -- Ya --\u003e G[Set program tujuan]\\nF -- Tidak --\u003e H[Masuk General Fund]\\n\\nG --\u003e I[Hitung Biaya/Komp Fee]\\nH --\u003e I\\n\\nI --\u003e J[Posting Jurnal\\\\n\u0026 Update Saldo Kas/Bank]\\nJ --\u003e K[Aturan Alokasi Otomatis\\\\n(operasional/cadangan/program)]\\nK --\u003e L[Generate Kwitansi \u0026 Notifikasi Donatur]\\nL --\u003e M[Rekonsiliasi Bank\\\\n(import mutasi)]\\nM --\u003e N{Match?}\\nN -- Ya --\u003e O[Tandai Tervalidasi\\\\n\u0026 Lock transaksi]\\nN -- Tidak --\u003e P[Daftar Unmatched\\\\nTindakan koreksi]\\n```\\n\\n## B. Alur Pengajuan \u0026 Penyaluran Bantuan\\n\\n```mermaid\\nflowchart TD\\nA[Petugas Program buat Pengajuan\\\\n(penerima, kebutuhan, nominal, lampiran)] --\u003e B[Validasi kelengkapan]\\nB --\u003e C[Skoring/Asesmen (opsional)]\\nC --\u003e D{Dana Program Cukup?}\\nD -- Tidak --\u003e D1[Rekomendasi Sumber Alternatif\\\\n(General Fund/Kampanye lain)]\\nD -- Ya --\u003e E[Approval Level 1 - Program]\\nE --\u003e F[Approval Level 2 - Keuangan]\\nF --\u003e G[Approval Level 3 - Pimpinan (jika \u003e threshold)]\\nG --\u003e H{Disetujui?}\\nH -- Tidak --\u003e H1[Tolak + Alasan\\\\nNotifikasi Pengusul]\\nH -- Ya --\u003e I[Eksekusi Penyaluran\\\\n(Transfer/Tunai/Batch)]\\nI --\u003e J[Unggah Bukti Serah \u0026 Berita Acara]\\nJ --\u003e K[Posting Jurnal \u0026 Update Saldo]\\nK --\u003e L[Update Status Penerima \u0026 Laporan Program]\\nL --\u003e M[Notifikasi Donatur terkait (jika restricted)]\\n```\\n\\n## C. Alur Donatur (Portal)\\n\\n```mermaid\\nflowchart LR\\nA[Registrasi/Donasi Tanpa Akun] --\u003e B[Pilih Program/Kampanye]\\nB --\u003e C[Pilih Kanal Pembayaran]\\nC --\u003e D[Bayar]\\nD --\u003e E[Terima E-Receipt \u0026 Ringkasan]\\nE --\u003e F[Lihat Dashboard Dampak\\\\n(riwayat, foto penyaluran, laporan)]\\n```\\n\\n---\\n\\n# Arsitektur Aplikasi (Singkat)\\n- **Frontend**: Web (SPA/SSR) + Portal Donatur + Panel Admin.\\n- **Backend**: REST/GraphQL API, job queue (notifikasi, rekonsiliasi, import mutasi).\\n- **DB**: Relasional (PostgreSQL/MySQL) dengan *row-level security* untuk cabang.\\n- **Integrasi**: Payment Gateway/QRIS/VA, Email/WhatsApp, Export Akuntansi.\\n- **Keamanan**: OAuth2/ JWT, 2FA, RBAC, audit log, enkripsi bukti.\\n- **Observabilitas**: Activity log, error tracking, metrik finansial.\\n\\n---\\n\\n# Validasi \u0026 Aturan Bisnis Penting\\n- **Dana Terikat (restricted)** hanya bisa disalurkan ke program tujuan.\\n- **Aturan Alokasi** dapat di-override hanya dengan approval.\\n- **Batasan Penyaluran**: tidak boleh melebihi saldo program + komitmen.\\n- **Rekonsiliasi Wajib** sebelum laporan bulanan dikunci.\\n- **Lampiran Wajib** untuk: pengajuan, penyaluran, \u0026 berita acara.\\n- **Threshold Approval** (mis: \u003e Rp5 juta perlu Level 3).\\n- **Nomor Dokumen** berformat: `DON-YYMM-####`, `PNY-YYMM-####`, `JUR-...`.\\n\\n---\\n\\n# Draft Skema Tabel (ringkas)\\n- `donors(id, name, type, contact, preferred_program_id, ...)`\\n- `beneficiaries(id, name, guardian, address, school, verified_at, ...)`\\n- `programs(id, name, type, target_amount, restricted, ...)`\\n- `campaigns(id, program_id, title, start_at, end_at, target, ...)`\\n- `donations(id, donor_id, channel, gross, fee, net, program_id_nullable, ref, status, proof_url, ...)`\\n- `allocations(id, donation_id, program_id, amount, ...)`\\n- `requests(id, beneficiary_id, program_id, need_desc, amount_requested, status, ...)`\\n- `approvals(id, object_type, object_id, level, approver_id, status, note, ...)`\\n- `disbursements(id, request_id, paid_at, method, amount, receipt_url, minutes_url, status, ...)`\\n- `accounts(id, code, name, type)` ; `account_entries(id, account_id, object_type, object_id, debit, credit, date)`\\n- `cashbanks(id, name, number, provider)` ; `cashbank_tx(id, cashbank_id, date, amount, direction, ref, matched_donation_id)`\\n- `audit_logs(id, actor_id, action, object, before, after, at)`\\n\\n---\\n\\n# Output \u0026 Laporan Kunci\\n- **Dashboard**: total donasi hari/bulan, unmatched, saldo per program, realisasi penyaluran, top donor/kampanye.\\n- **Laporan Keuangan**: arus kas, buku kas, rekonsiliasi, posisi dana terikat vs umum.\\n- **Laporan Program**: penerima terbantu, wilayah, jenis bantuan, rasio tepat sasaran.\\n- **Transparansi Donatur**: e-receipt, ringkasan dampak, foto/berita acara (dengan privasi).\\n\\n---\\n\\nJika kamu mau, langkah berikutnya aku bisa:\\n1) bikinkan **ERD kasar** (Mermaid),  \\n2) sketsa **API endpoint** (CRUD + transaksi),  \\n3) atau **wireframe dashboard** (Tailwind).\",{\"_4062\":4096,\"_4064\":4097,\"_4066\":4067,\"_4022\":4038,\"_4002\":4003,\"_4020\":4021,\"_4024\":4023,\"_4025\":4072,\"_4005\":4006,\"_4007\":4008,\"_3966\":3926},[],[],\"channel\",\"final\",[4101],\"16ad65e8-b45f-44c6-9416-691f5b83d481\",{\"_26\":4101,\"_3946\":4103,\"_3968\":4085,\"_3942\":4118},{\"_26\":4101,\"_3948\":4104,\"_3934\":4106,\"_3954\":4107,\"_3960\":3961,\"_3963\":1677,\"_3952\":4110,\"_3967\":3328},{\"_3950\":20,\"_3952\":4105},{},1760454009.316,{\"_3956\":3957,\"_3958\":4108},[4109],\"lanjutkan\",{\"_3992\":4111,\"_3994\":4112,\"_3996\":4113,\"_3998\":4114,\"_4002\":4116,\"_4004\":-5,\"_4005\":4117,\"_4007\":4008,\"_3966\":3926},[],[],[],{\"_4000\":4115},[],\"98e7f1d6cbd19cce-SIN\",\"1899b5e4-eeb8-4bbc-b8f6-4f151202f5c8\",[4119],\"0858caef-4232-45a9-bd57-af685b9aa5b5\",{\"_26\":4119,\"_3946\":4121,\"_3968\":4101,\"_3942\":4128},{\"_26\":4119,\"_3948\":4122,\"_3934\":4124,\"_3954\":4125,\"_3960\":3961,\"_3962\":47,\"_3963\":1660,\"_3952\":4127,\"_3967\":3328},{\"_3950\":3951,\"_3952\":4123},{},1760454019.1125932,{\"_3956\":3957,\"_3958\":4126},[23],{\"_4019\":47,\"_4002\":4116,\"_4020\":4021,\"_4022\":4023,\"_4024\":4023,\"_4025\":4101,\"_4005\":4117,\"_4007\":4008,\"_3966\":3926,\"_3965\":47},[4129],\"ae0533d8-34a8-4807-923f-e5b5a9729e82\",{\"_26\":4129,\"_3946\":4131,\"_3968\":4119,\"_3942\":4145},{\"_26\":4129,\"_3948\":4132,\"_3934\":4134,\"_3954\":4135,\"_3960\":3961,\"_3962\":32,\"_3963\":1677,\"_3952\":4142,\"_3967\":3328},{\"_3950\":4031,\"_3952\":4133},{},1760454019.851592,{\"_3956\":4048,\"_4048\":4136,\"_4057\":4141},[4137],{\"_4051\":4138,\"_3954\":4139,\"_4054\":4140,\"_4056\":47},\"Menyiapkan tugas pengguna\",\"Pengguna meminta untuk melanjutkan dengan ERD, API endpoint, dan wireframe. Mengingat mereka menggunakan Laravel multi-tenant, kita bisa menyediakan ERD dengan Mermaid, daftar endpoint API, dan wireframe HTML dengan Tailwind. Untuk wireframe HTML yang panjang, lebih baik memakai format kode melalui canvas, dan merujuknya di chat.\",[],\"38c957a2-349e-4e78-b5dc-aa158963c31f\",{\"_4060\":4061,\"_4062\":4143,\"_4064\":4144,\"_4066\":4067,\"_4068\":58,\"_4069\":4070,\"_4022\":4038,\"_4002\":4116,\"_4020\":4021,\"_4024\":4023,\"_4025\":4119,\"_4005\":4117,\"_4007\":4008,\"_3966\":3926},[],[],[4146],\"0bda4613-f402-4243-ba6c-02dc31472a90\",{\"_26\":4146,\"_3946\":4148,\"_3968\":4129,\"_3942\":4154},{\"_26\":4146,\"_3948\":4149,\"_3934\":4151,\"_3954\":4152,\"_3960\":3961,\"_3962\":32,\"_3963\":1677,\"_3952\":4153,\"_3967\":3328},{\"_3950\":4031,\"_3952\":4150},{},1760454035.654075,{\"_3956\":4079,\"_3954\":4080},{\"_4060\":4082,\"_4083\":1833,\"_4022\":4038,\"_4002\":4116,\"_4020\":4021,\"_4024\":4023,\"_4025\":4129,\"_4005\":4117,\"_4007\":4008,\"_3966\":3926},[4155],\"9e0ae2c5-a1b9-40bb-8705-b097d157bbc4\",{\"_26\":4155,\"_3946\":4157,\"_3968\":4146,\"_3942\":4170},{\"_26\":4155,\"_3948\":4158,\"_3934\":4160,\"_3936\":4161,\"_3954\":4162,\"_3960\":3961,\"_3962\":32,\"_3963\":1677,\"_3952\":4165,\"_3967\":4168,\"_4098\":4169},{\"_3950\":4031,\"_3952\":4159},{},1760454035.586035,1760454079.713745,{\"_3956\":3957,\"_3958\":4163},[4164],\"The output of this plugin was redacted.\",{\"_4062\":4166,\"_4064\":4167,\"_4066\":4067,\"_4002\":4116,\"_4020\":4021,\"_4022\":4023,\"_4024\":4023,\"_4025\":4146,\"_4005\":4117,\"_4007\":4008,\"_3966\":3926,\"_4039\":47},[],[],\"canmore.create_textdoc\",\"commentary\",[4171],\"1034ff8d-e7a9-4894-b38f-51cc99d72f94\",{\"_26\":4171,\"_3946\":4173,\"_3968\":4155,\"_3942\":4191},{\"_26\":4171,\"_3948\":4174,\"_3934\":4177,\"_3954\":4178,\"_3960\":3961,\"_3963\":1660,\"_3952\":4180,\"_3967\":3328},{\"_3950\":4175,\"_28\":4168,\"_3952\":4176},\"tool\",{},1760454080.9398878,{\"_3956\":3957,\"_3958\":4179},[4164],{\"_2384\":4181,\"_4189\":4190,\"_4002\":4116,\"_4020\":4021,\"_4022\":4023,\"_4024\":4023,\"_4025\":4155,\"_4005\":4117,\"_4007\":4008,\"_3966\":3926,\"_4039\":47},{\"_4182\":4183,\"_4184\":4185,\"_4186\":1677,\"_3932\":4187,\"_4188\":1954},\"textdoc_id\",\"68ee65bfdd7c8191bca290d30b916c5f\",\"textdoc_type\",\"code/html\",\"version\",\"Wireframe Sim Dana Yatim  Dashboard (tailwind)\",\"create_source\",\"command\",\"create_textdoc\",[4192],\"81715538-60f2-48be-b111-bbe43e90a18e\",{\"_26\":4192,\"_3946\":4194,\"_3968\":4171,\"_3942\":4205},{\"_26\":4192,\"_3948\":4195,\"_3934\":4197,\"_3936\":4198,\"_3954\":4199,\"_3960\":3961,\"_3962\":47,\"_3963\":1677,\"_3952\":4202,\"_3967\":3328,\"_4098\":4099},{\"_3950\":4031,\"_3952\":4196},{},1760454080.997384,1760454147.88637,{\"_3956\":3957,\"_3958\":4200},[4201],\"Mantap. Aku lanjut dengan tiga deliverable: **ERD**, **API design**, dan **wireframe dashboard** (Tailwind). Wireframe sudah aku taruh di canvas (bisa kamu lihat \u0026 edit langsung).\\n\\n# ERD (Mermaid)\\n\\n```mermaid\\nerDiagram\\n  USERS ||--o{ APPROVALS : \\\"approves\\\"\\n  USERS ||--o{ AUDIT_LOGS : \\\"actor\\\"\\n  USERS }o--o{ ROLES : \\\"USER_ROLES\\\"\\n  ROLES ||--o{ USER_ROLES : \\\"\\\"\\n\\n  ORG_UNITS ||--o{ USERS : \\\"belongs_to\\\"\\n  ORG_UNITS ||--o{ PROGRAMS : \\\"\\\"\\n  ORG_UNITS ||--o{ CASHBANKS : \\\"\\\"\\n  ORG_UNITS ||--o{ CAMPAIGNS : \\\"\\\"\\n\\n  DONORS ||--o{ DONATIONS : \\\"\\\"\\n  BENEFICIARIES ||--o{ REQUESTS : \\\"\\\"\\n  PROGRAMS ||--o{ CAMPAIGNS : \\\"\\\"\\n  PROGRAMS ||--o{ REQUESTS : \\\"\\\"\\n  PROGRAMS ||--o{ ALLOCATIONS : \\\"\\\"\\n  REQUESTS ||--o{ DISBURSEMENTS : \\\"\\\"\\n  DONATIONS ||--o{ ALLOCATIONS : \\\"\\\"\\n  CASHBANKS ||--o{ CASHBANK_TX : \\\"\\\"\\n  ACCOUNTS ||--o{ ACCOUNT_ENTRIES : \\\"\\\"\\n\\n  DONATIONS ||--o{ ATTACHMENTS : \\\"\\\"\\n  REQUESTS ||--o{ ATTACHMENTS : \\\"\\\"\\n  DISBURSEMENTS ||--o{ ATTACHMENTS : \\\"\\\"\\n\\n  DONORS {\\n    uuid id\\n    string name\\n    enum type \\\"individual/company\\\"\\n    string phone\\n    string email\\n    uuid preferred_program_id\\n    boolean kyc_verified\\n    timestamp created_at\\n  }\\n\\n  BENEFICIARIES {\\n    uuid id\\n    string name\\n    string guardian_name\\n    string address\\n    string school\\n    string grade\\n    boolean verified\\n    uuid org_unit_id\\n    timestamp created_at\\n  }\\n\\n  PROGRAMS {\\n    uuid id\\n    string name\\n    enum kind \\\"rutin/seasonal\\\"\\n    boolean restricted_default\\n    uuid org_unit_id\\n    numeric target_amount\\n    boolean active\\n  }\\n\\n  CAMPAIGNS {\\n    uuid id\\n    uuid program_id\\n    string title\\n    date start_at\\n    date end_at\\n    numeric target_amount\\n    boolean active\\n  }\\n\\n  DONATIONS {\\n    uuid id\\n    uuid donor_id\\n    uuid org_unit_id\\n    enum channel \\\"QRIS/VA/Transfer/Tunai/Gateway\\\"\\n    numeric gross\\n    numeric fee\\n    numeric net\\n    uuid earmark_program_id\\n    uuid campaign_id\\n    string external_ref\\n    enum status \\\"draft/validated/failed/matched\\\"\\n    timestamp paid_at\\n  }\\n\\n  ALLOCATIONS {\\n    uuid id\\n    uuid donation_id\\n    uuid program_id\\n    numeric amount\\n    text note\\n  }\\n\\n  REQUESTS {\\n    uuid id\\n    uuid beneficiary_id\\n    uuid program_id\\n    uuid org_unit_id\\n    text need_desc\\n    numeric amount_requested\\n    enum status \\\"draft/review/approved/rejected\\\"\\n    timestamp submitted_at\\n  }\\n\\n  APPROVALS {\\n    uuid id\\n    string object_type\\n    uuid object_id\\n    smallint level\\n    uuid approver_id\\n    enum decision \\\"pending/approved/rejected\\\"\\n    text note\\n    timestamp decided_at\\n  }\\n\\n  DISBURSEMENTS {\\n    uuid id\\n    uuid request_id\\n    date paid_at\\n    enum method \\\"Transfer/Tunai/Batch\\\"\\n    numeric amount\\n    enum status \\\"scheduled/paid/void\\\"\\n  }\\n\\n  CASHBANKS {\\n    uuid id\\n    uuid org_unit_id\\n    string provider\\n    string account_no\\n    string name\\n    numeric balance_cached\\n  }\\n\\n  CASHBANK_TX {\\n    uuid id\\n    uuid cashbank_id\\n    date tx_date\\n    string ref\\n    text description\\n    numeric amount\\n    enum direction \\\"in/out\\\"\\n    uuid matched_donation_id\\n    enum match_status \\\"unmatched/partial/matched\\\"\\n  }\\n\\n  ACCOUNTS {\\n    uuid id\\n    string code\\n    string name\\n    enum type \\\"asset/liability/equity/income/expense\\\"\\n  }\\n\\n  ACCOUNT_ENTRIES {\\n    uuid id\\n    uuid account_id\\n    string object_type\\n    uuid object_id\\n    numeric debit\\n    numeric credit\\n    date entry_date\\n  }\\n\\n  ATTACHMENTS {\\n    uuid id\\n    string object_type\\n    uuid object_id\\n    string url\\n    string kind\\n    string hash\\n  }\\n\\n  AUDIT_LOGS {\\n    uuid id\\n    uuid actor_id\\n    string action\\n    string object_type\\n    uuid object_id\\n    jsonb before\\n    jsonb after\\n    timestamp at\\n  }\\n\\n  USERS {\\n    uuid id\\n    uuid org_unit_id\\n    string name\\n    string email\\n    boolean two_fa\\n    boolean active\\n  }\\n\\n  ROLES {\\n    uuid id\\n    string name\\n  }\\n\\n  USER_ROLES {\\n    uuid user_id\\n    uuid role_id\\n  }\\n\\n  ORG_UNITS {\\n    uuid id\\n    string name\\n    string code\\n    uuid parent_id\\n  }\\n```\\n\\n## State Machine (ringkas)\\n\\n```mermaid\\nstateDiagram-v2\\n  [*] --\u003e DONATION_DRAFT\\n  DONATION_DRAFT --\u003e VALIDATED: match gateway/verified\\n  DONATION_DRAFT --\u003e FAILED: mismatch/invalid proof\\n  VALIDATED --\u003e MATCHED: rekonsiliasi bank ok\\n  VALIDATED --\u003e FAILED: dispute/chargeback\\n```\\n\\n```mermaid\\nstateDiagram-v2\\n  [*] --\u003e DRAFT\\n  DRAFT --\u003e REVIEW: submit\\n  REVIEW --\u003e APPROVED: L1/L2/L3 ok\\n  REVIEW --\u003e REJECTED\\n  APPROVED --\u003e DISBURSED: bayar\\n```\\n\\n---\\n\\n# API Design (REST, siap di-Laravel)\\n\\n**Konvensi**\\n- Auth: `Bearer \u003ctoken\u003e`, RBAC per role.\\n- Idempotency: header `Idempotency-Key` untuk endpoints transaksi.\\n- Pagination: `?page=1\u0026per_page=25`.\\n- Filtering: `?q=...\u0026status=...\u0026org_unit=...\u0026date_from=...\u0026date_to=...`.\\n\\n### 1) Auth \u0026 Users\\n- `POST /auth/login`\\n- `POST /auth/logout`\\n- `GET /me`\\n- `GET /users` / `POST /users` / `PATCH /users/{id}` / `DELETE /users/{id}`\\n- `GET /roles` / `POST /users/{id}/roles`\\n\\n### 2) Master\\n- `GET/POST/PATCH/DELETE /org-units`\\n- `GET/POST/PATCH/DELETE /donors`\\n- `GET/POST/PATCH/DELETE /beneficiaries`\\n- `GET/POST/PATCH/DELETE /programs`\\n- `GET/POST/PATCH/DELETE /campaigns`\\n\\n### 3) Donasi \u0026 Alokasi\\n- `POST /donations` (draft manual/tunai)\\n- `POST /donations/{id}/upload-proof`\\n- `POST /donations/{id}/validate`\\n- `POST /donations/{id}/allocate` body: `{ allocations:[{program_id, amount}] }`\\n- `GET /donations?status=\u0026campaign_id=`\\n- `GET /donations/{id}`\\n\\n### 4) Rekonsiliasi Kas/Bank\\n- `POST /cashbanks` / `GET /cashbanks`\\n- `POST /cashbanks/{id}/import-statement` (CSV)\\n- `GET /cashbanks/{id}/transactions?match_status=`\\n- `POST /cashbank-tx/{tx_id}/match` body: `{ donation_id }`\\n- `POST /cashbank-tx/{tx_id}/split` body: `{ splits:[{donation_id, amount}] }`\\n\\n### 5) Pengajuan \u0026 Approval\\n- `POST /requests` / `GET /requests?status=`\\n- `POST /requests/{id}/submit`\\n- `POST /approvals/{object}/{id}/decision` body: `{ level, decision, note }`\\n- `GET /approvals/queue?level=\u0026org_unit=`\\n\\n### 6) Penyaluran\\n- `POST /disbursements` body: `{ request_id, method, amount, paid_at }`\\n- `POST /disbursements/batch` body: `{ items:[{request_id, amount}], method }`\\n- `GET /disbursements?status=`\\n- `POST /disbursements/{id}/void`\\n\\n### 7) Lampiran, Audit, Notifikasi\\n- `POST /attachments` body: `{ object_type, object_id, file }`\\n- `GET /audit-logs?object_type=\u0026object_id=`\\n- `POST /notify` body: `{ to:'whatsapp|email', template, data }`\\n\\n### 8) Laporan \u0026 Transparansi\\n- `GET /reports/cashflow?period=YYYY-MM`\\n- `GET /reports/program-balance?program_id=`\\n- `GET /reports/donations-summary?from=\u0026to=`\\n- `GET /donor-portal/me/donations`\\n- `GET /donor-portal/me/impact`\\n\\n**Contoh Payload (singkat)**\\n\\n```json\\n// POST /donations\\n{\\n  \\\"donor_id\\\": \\\"uuid\\\",\\n  \\\"channel\\\": \\\"Transfer\\\",\\n  \\\"gross\\\": 1000000,\\n  \\\"fee\\\": 0,\\n  \\\"earmark_program_id\\\": null,\\n  \\\"campaign_id\\\": null,\\n  \\\"paid_at\\\": \\\"2025-10-14T10:02:00+07:00\\\",\\n  \\\"external_ref\\\": \\\"FT240915AB12\\\"\\n}\\n```\\n\\n```json\\n// POST /requests\\n{\\n  \\\"beneficiary_id\\\": \\\"uuid\\\",\\n  \\\"program_id\\\": \\\"uuid\\\",\\n  \\\"need_desc\\\": \\\"Biaya seragam \u0026 buku\\\",\\n  \\\"amount_requested\\\": 1500000,\\n  \\\"attachments\\\": [\\\"file-id-1\\\",\\\"file-id-2\\\"]\\n}\\n```\\n\\n---\\n\\n# Aturan Bisnis \u0026 Guardrails (lanjutan)\\n- **Threshold approval** konfigurable per org unit \u0026 program (contoh: \u003e Rp5jt wajib L3).\\n- **Dana terikat**: alokasi \u0026 penyaluran hanya dari saldo program terkait; blokir jika kurang.\\n- **Rekonsiliasi**: status donasi validated  matched hanya jika `cashbank_tx` terhubung penuh.\\n- **Auditability**: semua perubahan objek transaksi wajib tercatat (before/after).\\n- **Dokumen otomatis**: nomor `DON-YYMM-####`, `REQ-YYMM-####`, `DBS-YYMM-####`.\\n- **Privasi**: mask data penerima pada portal donatur (inisial/nama samaran).\\n\\n---\\n\\n# Wireframe (Tailwind)\\n- Sudah aku buat di canvas: **Wireframe SIM Dana Yatim  Dashboard (Tailwind)** berisi:\\n  - Filter Periode/Cabang/Program\\n  - KPI Cards (Donasi, Penyaluran, Dana Terikat, Unmatched)\\n  - Placeholder grafik (trend \u0026 komposisi)\\n  - Tabel **Antrian Persetujuan** \u0026 **Rekonsiliasi Unmatched**\\n\\nKalau cocok, next aku bisa:\\n1) bikin **ERD ke migration** (Laravel 12) + seeding minimal,\\n2) **endpoint Laravel** (routes + Request validation + Policy RBAC),\\n3) atau **UI CRUD** dasar (Filament v3) untuk Donasi/Request/Approval/Disbursement.\",{\"_4062\":4203,\"_4064\":4204,\"_4066\":4067,\"_4022\":4038,\"_4002\":4116,\"_4020\":4021,\"_4
